import React from 'react'
import axios from "axios";
import { useEffect, useState } from 'react';

function Recipes() {

    const [listOfRecipes, setlistOfRecipes] = useState([]);

    useEffect(() => {
      axios.get("http://localhost:3001/recipes").then((response) => {
        setlistOfRecipes(response.data);
        //console.log(response.data);
      });
    }, []);

  return (
    <div className="App">{listOfRecipes.map((value, key) => { 
        return (
          <div className="recipes">
            <div className='name'>{value.name}</div> 
            <div className='body'>
                {/* <div className='quantity'>Quantity: {value.quantity * 100}g</div>
                <div className='calories'>Calories: {value.totalCalories}</div> */}
                <div className='ingredients'>
                    Ingredients:
                    {Object.entries(value.ingredients).map(([key, value]) => (
                        <span key={key}>
                        {key}: {value}{', '}
                        </span>
                    ))}
                </div>
            </div>
            <div className='category'>{value.category}</div>
          </div>
        );
      })}
      </div>
  )
}

export default Recipes
